import React from "react";

function List({ contacts }) {
  return (
    <div>
      <ul>
        {contacts.map((contact) => {
          <li key={contact.id}>{contact.fullName}</li>;
          <li key={contact.id}>{contact.fullName}</li>;
        })}
      </ul>
    </div>
  );
}

export default List;
